import React from 'react';
import { Link } from 'react-router-dom';
import './Navbar.css';

const Navbar = () => {
    const activeLinkStyles = {
        color: 'red',
    };
    return (
        <div className="navbar">
            <Link to="/" className="navbar-item" activeClass="active" style={activeLinkStyles}>Home</Link>
            <Link to="/about" className="navbar-item" activeClass="active" style={activeLinkStyles}>About</Link>
            <Link to="/services" className="navbar-item" activeClass="active" style={activeLinkStyles}>Services</Link>
            <Link to="/contact" className="navbar-item" activeClass="active" style={activeLinkStyles}>Contact</Link>
        </div>
    );
}

export default Navbar;
